import{_ as a,c as t,o,ag as n}from"./chunks/framework.Ds6Eueu6.js";const A=JSON.parse('{"title":"ALTER FOREIGN DATA WRAPPER","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_FOREIGN_DATA_WRAPPER.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_FOREIGN_DATA_WRAPPER.md"}'),i={name:"docs/7x/ref_guide/sql_commands/ALTER_FOREIGN_DATA_WRAPPER.md"};function s(r,e,p,d,c,l){return o(),t("div",null,e[0]||(e[0]=[n(`<h1 id="alter-foreign-data-wrapper" tabindex="-1">ALTER FOREIGN DATA WRAPPER <a class="header-anchor" href="#alter-foreign-data-wrapper" aria-label="Permalink to &quot;ALTER FOREIGN DATA WRAPPER&quot;">​</a></h1><p>Changes the definition of a foreign-data wrapper.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER FOREIGN DATA WRAPPER &lt;name&gt;</span></span>
<span class="line"><span>    [ HANDLER &lt;handler_function&gt; | NO HANDLER ]</span></span>
<span class="line"><span>    [ VALIDATOR &lt;validator_function&gt; | NO VALIDATOR ]</span></span>
<span class="line"><span>    [ OPTIONS ( [ ADD | SET | DROP ] &lt;option&gt; [&#39;&lt;value&gt;&#39;] [, ... ] ) ]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER FOREIGN DATA WRAPPER &lt;name&gt; OWNER TO { &lt;new_owner&gt; | CURRENT_USER | SESSION_USER }</span></span>
<span class="line"><span>ALTER FOREIGN DATA WRAPPER &lt;name&gt; RENAME TO &lt;new_name&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER FOREIGN DATA WRAPPER</code> changes the definition of a foreign-data wrapper. The first form of the command changes the support functions or generic options of the foreign-data wrapper. WarehousePG requires at least one clause. The second and third forms of the command change the owner or name of the foreign-data wrapper.</p><p>Only superusers can alter foreign-data wrappers. Additionally, only superusers can own foreign-data wrappers</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name of an existing foreign-data wrapper.</p><p>HANDLER handler_function : Specifies a new handler function for the foreign-data wrapper.</p><p>NO HANDLER : Specifies that the foreign-data wrapper should no longer have a handler function.</p><pre><code>&gt; **Note** You cannot access a foreign table that uses a foreign-data wrapper with no handler.
</code></pre><p>VALIDATOR validator_function : Specifies a new validator function for the foreign-data wrapper.</p><p>: Note that it is possible that pre-existing options of the foreign-data wrapper, or of dependent servers, user mappings, or foreign tables, may become invalid when you change the validator function. WarehousePG does not check for this. You must make sure that these options are correct before using the modified foreign-data wrapper. However, WarehousePG will check any options specified in this <code>ALTER FOREIGN DATA WRAPPER</code> command using the new validator.</p><p>NO VALIDATOR : Specifies that the foreign-data wrapper should no longer have a validator function.</p><p>OPTIONS ( [ ADD | SET | DROP ] option [&#39;value&#39;] [, ... ] ) : Change the foreign-data wrapper&#39;s options. <code>ADD</code>, <code>SET</code>, and <code>DROP</code> specify the action to perform. If no operation is explicitly specified, the default operation is <code>ADD</code>. Option names must be unique. WarehousePG validates names and values using the foreign-data wrapper&#39;s validator function, if any.</p><p>OWNER TO new_owner : Specifies the user name of the new owner of the foreign-data wrapper. Only superusers can own foreign-data wrappers.</p><p>RENAME TO new_name : Specifies the new name of the foreign-data wrapper.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Change the definition of a foreign-data wrapper named <code>dbi</code> by adding a new option named <code>foo</code>, and removing the option named <code>bar</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER FOREIGN DATA WRAPPER dbi OPTIONS (ADD foo &#39;1&#39;, DROP &#39;bar&#39;);</span></span></code></pre></div><p>Change the validator function for a foreign-data wrapper named <code>dbi</code> to <code>bob.myvalidator</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER FOREIGN DATA WRAPPER dbi VALIDATOR bob.myvalidator;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>ALTER FOREIGN DATA WRAPPER</code> conforms to ISO/IEC 9075-9 (SQL/MED), with the exception that the <code>HANDLER</code>, <code>VALIDATOR</code>, <code>OWNER TO</code>, and <code>RENAME TO</code> clauses are WarehousePG extensions.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_FOREIGN_DATA_WRAPPER.html">CREATE FOREIGN DATA WRAPPER</a>, <a href="./DROP_FOREIGN_DATA_WRAPPER.html">DROP FOREIGN DATA WRAPPER</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,28)]))}const R=a(i,[["render",s]]);export{A as __pageData,R as default};
